return ['project-id-version'=>'OTYS Jobs & Apply','pot-creation-date'=>'2024-03-27 13:58+0100','po-revision-date'=>'2024-05-23 07:44+0000','last-translator'=>'','language-team'=>'Nederlands','language'=>'nl_NL','mime-version'=>'1.0','content-type'=>'text/plain; charset=UTF-8','content-transfer-encoding'=>'8bit','plural-forms'=>'nplurals=2; plural=(n != 1);','x-generator'=>'Loco https://localise.biz/','x-poedit-basepath'=>'..','x-poedit-flags-xgettext'=>'--add-comments=translators:','x-poedit-wpheader'=>'otys-jobs-apply.php','x-poedit-sourcecharset'=>'UTF-8','x-poedit-keywordslist'=>'__;_e;_n:1,2;_x:1,2c;_ex:1,2c;_nx:4c,1,2;esc_attr__;esc_attr_e;esc_attr_x:1,2c;esc_html__;esc_html_e;esc_html_x:1,2c;_n_noop:1,2;_nx_noop:3c,1,2;__ngettext_noop:1,2','x-poedit-searchpath-0'=>'.','x-poedit-searchpathexcluded-0'=>'*.min.js','x-poedit-searchpathexcluded-1'=>'vendor','x-poedit-searchpathexcluded-2'=>'node_modules','report-msgid-bugs-to'=>'','x-loco-version'=>'2.6.9; wp-6.5.3','messages'=>['Vacancies overview'=>'Vacatures overzicht','Vacancy detail'=>'Vacature detail','The API key has been removed.'=>'De API sleutel is verwijderd.','Choose what url you want to use for the vacancies overview. This url should correspond with the page containing atleast a [otys-vacancies-list] shortcode. Add a vacancies overview url for each language. If your language is not available in the dropdown, make sure to install the language in your WordPress installation.'=>'Kies welke url je wilt gebruiken voor het vacatureoverzicht. Deze url moet overeenkomen met de pagina die ten minste een [otys-vacatures-overzicht] shortcode bevat. Voeg een vacatureoverzicht url toe voor elke taal. Als je taal niet beschikbaar is in de dropdown, zorg er dan voor dat je de taal installeert in je WordPress installatie.','Choose what url you want to use for the vacancies detail page. The vacancy detail page can be the same url as the vacancy overview url. Add a vacancies detail url for each language. If your language is not available in the dropdown, make sure to install the language in your WordPress installation.'=>'Kies welke url je wilt gebruiken voor de vacaturedetailpagina. De vacaturedetailpagina kan dezelfde url zijn als de vacatureoverzicht url. Voeg een vacaturedetail url toe voor elke taal. Als je taal niet beschikbaar is in de dropdown, zorg er dan voor dat je de taal installeert in je WordPress installatie.','Vacancy application thank you'=>'Vacature sollicitatie bedankt','Optionally you can choose what url you want to use for the thank you page after a candidate has applied for a vacancy. You can add a different thank you url for each language. If your language is not available in the dropdown, make sure to install the language in your WordPress installation.'=>'Optioneel kunt u kiezen welke url u wilt gebruiken voor de bedankpagina nadat een kandidaat op een vacature heeft gesolliciteerd. U kunt voor elke taal een andere bedank-URL toevoegen. Als uw taal niet beschikbaar is in de vervolgkeuzelijst, zorg er dan voor dat u de taal in uw WordPress-installatie installeert.','API'=>'API','Vacancies'=>'Vacatures','Mailing'=>'Mailing','Anti spam'=>'Anti spam','URL\'s'=>'URL\'s','Pagination'=>'Paginering','All plugin related cache has been removed'=>'Alle plugin gerelateerde cache is verwijderd','Invalid API key given'=>'Ongeldige API sleutel gegeven','Api settings'=>'API instellingen','API key'=>'API key','Enter the API key provided by OTYS.'=>'Voer de door OTYS verstrekte API sleutel in.','Brand'=>'Merk','Choose which brand to use.'=>'Kies welk merk u wilt gebruiken.','Website status'=>'Website status','No, this website is not available to the public. (i.e. development environment)'=>'Nee, deze website is niet beschikbaar voor het publiek. (d.w.z. ontwikkelomgeving)','Yes, this website is available to the public.'=>'Ja, deze website is beschikbaar voor het publiek.','Production means that this website is used by the end-user and the website is live. <br><b>Note</b>: Only one website can be used as production website per brand, if you mark more than one website as production issues will occur.'=>'Productie betekent dat deze website wordt gebruikt door de eindgebruiker en dat de website live is. <br><b>Opmerking</b>: Slechts één website kan worden gebruikt als productie website, indien u meer dan één website als productie markeert zullen er problemen optreden.','Google reCAPTCHA v3'=>'Google reCAPTCHA v3','Setting up recaptcha is required. Please use your Google account to generate the needed API keys. Please make sure to choose reCAPTCHA v3 as type and add <u>%s</u> to the list of domains.'=>'Het instellen van recaptcha is vereist. Gebruik uw Google-account om de benodigde API-sleutels te genereren. Zorg ervoor dat u reCAPTCHA v3 kiest als type en voeg toe <u>%s</u> toe aan de lijst met domeinen.','Create API Key'=>'API-sleutel aanmaken','Site key'=>'Sitesleutel','This site key is used in the HTML code your site serves to users.'=>'Deze site sleutel wordt gebruikt in de HTML code die je site aan gebruikers voorschotelt.','Secret Key'=>'Geheime sleutel','This secret key is used for communication between your site and reCAPTCHA.'=>'Deze geheime sleutel wordt gebruikt voor de communicatie tussen je site en reCAPTCHA.','Threshold'=>'Grenswaarde','reCAPTCHA learns by seeing real traffic on your site. For this reason, scores in a staging environment or soon after implementing may differ from production. As reCAPTCHA v3 doesn\'t ever interrupt the user flow, you can first run reCAPTCHA without taking action and then decide on thresholds by looking at your traffic in the admin console. By default, you can use a threshold of 0.5.'=>'reCAPTCHA leert door echt verkeer op je site te zien. Daarom kunnen scores in een staging omgeving of kort na het implementeren verschillen van die in productie. Omdat reCAPTCHA v3 de gebruikersstroom nooit onderbreekt, kun je reCAPTCHA eerst laten lopen zonder actie te ondernemen en dan drempels bepalen door je verkeer in het beheerconsole te bekijken. Standaard kun je een drempel van 0.5 gebruiken.','Vacancy Overview'=>'Vacature Overzicht','Vacancies per page'=>'Vacatures per pagina','The amount of vacancies displayed per page on the vacancy overview.'=>'Aantal getoonde vacatures per pagina.','Sorting of filter options'=>'Sortering van filteropties','The sorting of the options of each filter'=>'De sortering van de opties van elk filter','Alphabetic'=>'Alfabetisch','Frequency'=>'Frequentie','Vacancy filters'=>'Vacature filters','The filters displayed when using the shortcode [otys-vacancies-filters].'=>'De filters die worden weergegeven bij gebruik van de shortcode [otys-vacatures-filters].','Vacancy labels'=>'Vacature labels','Labels displayed at the vacancies displayed with the shortcodes [otys-vacancies-list] and [otys-vacancies-shortlist].'=>'Labels getoond bij de vacatures getoond met de shortcodes [otys-vacatures-list] en [otys-vacatures-shortlist].','Vacancy Detail'=>'Vacature Detail','Fallback header image'=>'Fallback header afbeelding','The header to show when no vacancy header is set.'=>'De header afbeelding die wordt weergegeven als er geen vacature header afbeelding  is ingesteld.','Choose fallback header image'=>'Kies een header afbeelding om op terug te vallen','Use image'=>'Gebruik afbeelding','Vacancy labels displayed on the vacancy detail.'=>'Kies welke matchcriteria standaard in de vacaturefilters getoond worden.','Mails'=>'Mails','Application'=>'Applicatie','Candidate applied (existing)'=>'Kandidaat gesolliciteerd (bestaand)','Email when an existing candidate applied for a job'=>'E-mail wanneer een bestaande kandidaat heeft gesolliciteerd','Candidate applied (new)'=>'Kandidaat gesolliciteerd (nieuw)','Email when a new candidate applied for a job.'=>'E-mail wanneer een nieuwe kandidaat voor een baan heeft gesolliciteerd.','Candidate confirm email'=>'Kandidaat bevestigt e-mail','When a candidate applies with a known email adres, the candidate will receive an email with a code, the code needs to be filled in at the last step of the application proces to continue the application.'=>'Wanneer een kandidaat solliciteert met een bekend e-mailadres, ontvangt de kandidaat een e-mail met een code. Deze code moet bij de laatste stap van het sollicitatieproces worden ingevuld om verder te kunnen solliciteren.','Vacancy owner application notification'=>'Kennisgeving van vacature eigenaar','Notification to vacancy owner when a candidate applied on a vacancy.'=>'Kennisgeving aan de vacaturehouder wanneer een kandidaat op een vacature heeft gesolliciteerd.','Open application'=>'Open sollicitatie','Candidate open application'=>'Kandidaat open sollicitatie','Email to candidate when candidate did an open application.'=>'Email wanneer kandidaat een open sollicitatie heeft gedaan.','Candidate open application notification consultant'=>'E-mail notificatie aan adviseur voor nieuwe aanvragers','Email to chosen recipient after a candidate did a open application.'=>'Email wanneer kandidaat een open sollicitatie heeft gedaan.','Open application email recipient'=>'Open sollicitatieformulier','i.e. name@%s'=>'d.w.z. name@%s','The e-mail adres a open application notifcation gets send to.'=>'Het e-mail adres waarnaar een open sollicitatie notificatie wordt gestuurd.','Mail sender'=>'Mail afzender','Force sending all mails from one user'=>'Forceer het verzenden van alle e-mails van één gebruiker','When this setting is enabled mails will never be send from the consultant. Instead mails will be send from the mail address assigned to the API.'=>'Wanneer deze instelling is ingeschakeld zullen e-mails nooit worden verzonden vanaf de consultant. In plaats daarvan worden e-mails verzonden vanaf het e-mailadres dat is toegewezen aan de API.','URL Settings'=>'URL-instellingen','Choose which page to use for each module. This way the plugin knows where the pages are located and how the url\'s should be structured. Make sure to choose the correct language.'=>'Kies voor elke module welke pagina gebruikt moet worden. Zo weet de plugin waar de pagina\'s zich bevinden en hoe de url\'s gestructureerd moeten worden. Zorg ervoor dat je de juiste taal kiest.','Maximum amount of pages'=>'Maximaal aantal pagina\'s','The maximum amount of pages shown in the pagination.'=>'Het maximum aantal pagina\'s dat in de paginering wordt getoond.','Previous and next buttons'=>'Vorige en volgende knoppen','How to show the previous and next buttons.'=>'Hoe de vorige en volgende knop te tonen.','Hide previous and next button'=>'Verberg vorige en volgende knop','Show previous and next button as text'=>'Toon vorige en volgende knop als tekst','Show previous and next button as icon'=>'Toon vorige en volgende knop als pictogram','Previous page button'=>'Vorige pagina knop','How to show the first and last buttons.'=>'Hoe toon je de eerste en de laatste knop.','Choose the icon to be used for the previous page button'=>'Kies het pictogram voor de knop Vorige pagina','Use as icon'=>'Gebruik als pictogram','Next page button'=>'Volgende Pagina button','Choose the icon to be used for the next page button.'=>'Kies het pictogram voor de knop Volgende pagina.','Choose icon to be used for the next page button'=>'Kies een pictogram voor de knop Volgende pagina','First and last buttons'=>'Eerste en laatste knop','Hide first and last button button'=>'Verberg eerste en laatste knop','Show first and last button as text'=>'Toon eerste en laatste knop als tekst','Show first and last button as icon'=>'Toon eerste en laatste knop als pictogram','First page button'=>'Eerste pagina knop','Choose icon to be used for the first page button'=>'Kies een pictogram voor de knop van de eerste pagina','Last page button'=>'Laatste pagina knop','Choose icon to be used for the last page button'=>'Kies het icoon die word gebruikt voor de laatste pagina knop','Are you sure you want to remove the API Key? You will loose plugin related settings and all plugin related cache will be removed.'=>'Weet u zeker dat u de API sleutel wilt verwijderen? Je verliest dan plugin gerelateerde instellingen en alle plugin gerelateerde cache wordt verwijderd.','Remove API key'=>'Verwijder API key','Connected to %s'=>'Verbonden met %s','Webhook url'=>'Webhooks','The webhook url should on live websites always point at %1$s. 
                    It is not recommended to change this url. This setting is here solely for development purposes. 
                    For safety this setting only gets used when debug mode is on. 
                    Remember to click the Register hooks button to register hooks with OTYS, otherwise changes will not have any effect. 
                    To make sure the correct webhooks are registered, see the list of registed webhooks below.'=>'De webhook url moet op live websites altijd naar %1$s wijzen
                    Het is niet aan te raden deze url te wijzigen. Deze instelling is hier alleen voor ontwikkelingsdoeleinden
                    Voor de veiligheid wordt deze instelling alleen gebruikt als debug modus aan staat
                    Vergeet niet op de knop Haken registreren te klikken om haken bij OTYS te registreren, anders hebben wijzigingen geen effect
                    Om er zeker van te zijn dat de juiste webhooks zijn geregistreerd, zie de lijst van geregistreerde webhooks hieronder.','Please setup the recaptcha key correctly, otherwise the interaction form will not work. If you need help please read the article <a target="_blank" href="https://wordpress.otys.com/kb/guide/en/QIkQJMUsa2/">How do I setup Google Recaptcha?</a> on our knowledge base.'=>'Stel de recaptcha-sleutel correct in, anders werkt het interactieformulier niet. Als u hulp nodig heeft, lees dan het artikel <a target="_blank" href="https://wordpress.otys.com/kb/guide/en/QIkQJMUsa2/">Hoe stel ik Google Recaptcha in?</a> op onze kennisbank.','Please setup the recaptcha key correctly, otherwise the application form will not work. If you need help please read the article <a target="_blank" href="https://wordpress.otys.com/kb/guide/en/QIkQJMUsa2/">How do I setup Google Recaptcha?</a> on our knowledge base.'=>'Stel de recaptcha correct in, anders zal het aanvraagformulier niet werken. Als je hulp nodig hebt, lees dan het artikel <a target="_blank" href="https://wordpress.otys.com/kb/guide/en/QIkQJMUsa2/">Hoe stel ik Google Recaptcha in?</a> op onze kennisbank.','Email adres is already used, please choose a different email adres.'=>'Het e-mailadres is al in gebruik. Kies een ander e-mailadres.','You\'ve already applied on this vacancy with this email adres.'=>'Je hebt al gesolliciteerd op deze vacature met dit e-mailadres.','Something went wrong. Please contact %s to make sure your application went through.'=>'Er ging iets mis. Neem contact op met %s, om er zeker van te zijn dat de sollicitatie is gelukt.','Application failed, please contact us.'=>'Aanvraag mislukt, neem dan contact met ons op.','No vacancies found.'=>'Geen vacatures gevonden','Apply for %1$s'=>'Solliciteer als %1$s','Vacancy detail title%1$s'=>'%1$s','Edit settings'=>'Instellingen bewerken','How to contact support?'=>'Hoe neemt u contact op met ondersteuning?','Failed updating version %s to version %s. The updater failed at version %s. Please create a OTYS support ticket and provide this information in the ticket. %s'=>'Mislukt bij het updaten van versie %s naar versie %s. Mislukt bij update %s. Maak een OTYS support ticket aan en geef deze informatie mee in het ticket. %s','API key provided is invalid.'=>'De gegeven API key is foutief.','Session provided with the request is invalid.'=>'De sessie die bij het verzoek is geleverd, is ongeldig.','No error message available.'=>'Geen foutmelding beschikbaar.','Could not create candidate.'=>'Kon kandidaat niet aanmaken.','Invalid file upload.'=>'Foutief bestand geüpload.','%s is an invalid file.'=>'%s is een ongeldig bestand.','File %1$s exceeds filesize limit. Max file size is %2$s.'=>'Bestand %1$s overschrijdt de bestandsgroottelimiet. De maximale bestandsgrootte is %2$s.','File extension of %s is not allowed.'=>'Bestandsextensie van %s is niet toegestaan.','No file uploaded'=>'Geen bestand geüpload','File %s exceeds filesize limit.'=>'Bestand %s overschrijdt bestandsgroottelimiet.','Something went wrong while uploading your documents.'=>'Er ging iets mis, neem contact op met deze server admin.','no subject'=>'geen onderwerp','No message set for email.'=>'Geen bericht ingesteld voor e-mail.','First'=>'Eerste','Prev'=>'Vorige','Next'=>'Volgende','Last'=>'Laatste','Wrong questionset UID'=>'Verkeerde vragenset UID','GDPR%s months'=>'%s maanden','Response open questionset is invalid'=>'Antwoord open vragenset is ongeldig','This field is required.'=>'Dit veld is verplicht.','File upload is required.'=>'Bestand uploaden is vereist.','Value should be a valid date.'=>'De waarde moet een geldige datum zijn.','Postal code is invalid.'=>'Postcode is ongeldig.','Too many digits.'=>'Te veel cijfers.','Invalid email adres.'=>'Ongeldig e-mail adres.','Only numbers & letters are allowed.'=>'Alleen cijfers & letters zijn toegestaan.','Invalid phonenumber.'=>'Ongeldig telefoonnummer.','Please enter a internationa