ideo'=>'Bekijk documenten module instructievideo','Registered webhooks'=>'Geregistreerde webhooks','Register hooks'=>'Registreer webhooks','Select option'=>'Selecteer optie','Choose image'=>'Afbeelding kiezen','Set image'=>'Afbeelding instellen','Select image'=>'Selecteer afbeelding','Remove image'=>'Verwijder afbeelding','Select documents'=>'Selecteer documenten','Disabled'=>'Uitgeschakeld','Select match criteria'=>'Selecteer match criteria','Select options'=>'Selecteer opties','Previous'=>'Vorige','Apply'=>'Solliciteer','Thank you for your application. You have successfully applied for the vacancy %s.'=>'Dank je voor je sollicitatie. Je hebt succesvol gesolliciteerd op de vacature %s.','You are currently applying for'=>'Je solliciteert momenteel op','We sent a confirmation code to your email address. Please confirm your application by filling in the confirmation code.'=>'We hebben een bevestigingscode naar jouw e-mailadres verstuurd. Bevestig jouw sollicitatie door de bevestigingscode hier in te vullen.','Confirmation code'=>'Bevestigingscode','Enter the confirmation code here'=>'Voer hier de bevestigingscode hier in','Thank you for your application.'=>'Bedankt voor jouw sollicitatie.','Preview mode'=>'Voorbeeldmodus','ago'=>'geleden','Filters'=>'Filters','Maximum distance'=>'Maximale afstand','Postal code'=>'Postcode','Reset'=>'Resetten','Search'=>'Zoeken','Vacancy %s'=>'Vacature %1$s','No vacancies found'=>'Geen vacatures gevonden','There are no vacancies for your search filters. Remove filters to broaden the search.'=>'Er zijn geen vacatures voor je zoekfilters. Verwijder filters om het zoeken te verbreden.','Remove all filters'=>'Alle filters verwijderen','Search vacancies'=>'Vacatures zoeken','Keyword'=>'Trefwoord','or'=>'of','Settings'=>'Instellingen','Cache'=>'Cache','Webhooks'=>'Webhooks','API Logs'=>'API Logs','Instructions'=>'Instructies','OTYS Jobs & Apply'=>'OTYS Jobs & Solliciteer','Make your Wordpress website a proper recruitment website using the OT